    void Calculate()
    {
        decimal decGrossValue = 0;
        decimal decPercentgeDiscount = 0;
        decimal decTtlDiscount = 0;
        decimal decNetValue = 0;
        decimal decTaxAmount = 0;
        decimal decTotalTax = 0;
        decimal decGrndTotl = 0;
        if (Convert.ToDecimal(product.Qty) > 0 && Convert.ToDecimal(product.Rate) > 0)
        {
            decGrossValue = Convert.ToDecimal(product.Rate) * Convert.ToDecimal(product.Qty);

            decPercentgeDiscount = Convert.ToDecimal(product.DiscountAmount) * 100 / decGrossValue;
            decTtlDiscount = decPercentgeDiscount;
            product.Discount = decTtlDiscount;

            decNetValue = decGrossValue - Convert.ToDecimal(product.DiscountAmount);

            //ClculteT
            decTaxAmount = decNetValue * product.TaxRate / 100;
            product.TaxAmount = Math.Round(decTaxAmount, PublicVariables._inNoOfDecimalPlaces);


            decGrndTotl = decNetValue;
            mster.TotalTax = Math.Round(decTotalTax, PublicVariables._inNoOfDecimalPlaces);
            product.NetAmount = Math.Round(decNetValue, PublicVariables._inNoOfDecimalPlaces);
            product.TotalAmount = Math.Round(decGrndTotl, PublicVariables._inNoOfDecimalPlaces);
        }
        else
        {
            product.Discount = 0;
        }
    }
